import Rebase from "re-base";
import firebase from "firebase";

const firebaseApp = firebase.initializeApp({
    apiKey: "AIzaSyC2YEe5hzjiyUgs0ys77hwPDE-LIMu6mV0",
    authDomain: "catch-of-the-day-shaun-zom.firebaseapp.com",
    databaseURL: "https://catch-of-the-day-shaun-zom.firebaseio.com"
});

const base = Rebase.createClass(firebaseApp.database());

//This is a named export
export { firebaseApp };

//This is a default export
export default base;
